import React from 'react';
import './MainPage.css'

function MainPage() {
    return (
      <div className='search'> 
      <header></header>
        <form className='bar'>
          {/* <label htmlFor="fname">First name:</label><br /> */}
          <input type="text" id="search" name="fname" value="" placeholder='Seach Here'/><br />
          <input type="submit" value="Submit"/>
        </form> 
      </div>
    );
  }

export default MainPage;
